import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonImg, IonButtons, IonMenuButton } from '@ionic/react';

function Home() {
  return (
    <IonPage>
        <IonHeader>
          <IonToolbar color='dark'>
            <IonTitle>Home</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonContent class='padding-start'>
            The world is your oyster.
            <p>If you get lost, the <a target="_blank" rel="noopener" href="https://reactjs.org">docs</a> will be your guide</p>
        </IonContent>
    </IonPage>
  );
};

export default Home;
